  {body: "There is a whole field of Synthetic biology that includes efforts to design biological circuits. There are also research efforts to create synthetic organisms, notably by Craig Venter.\r\n\r\nGenetic Programming\r\n\r\nOur goal is to create a programming language for living cells that is similar to languages used to program computers and robots. This requires the development of a high-level language that allows a programmer to describe a desired function and computational methods that convert this language into a linear DNA sequence. The sequence is then built and inserted into an organism, which runs the program. Examples of programs built by the SBC include an edge detection program that gives bacteria the ability to identify the light-dark interfaces in an image, a program that forms two-dimensional patterns, and one that enables bacteria to count.\r\n\r\nMIT Synthetic Biology Center \r\nSynthetic biological circuit \r\nSynthetic Biology: FAQ \r\n\r\nIn 2010, Science reported that the Venter group had successfully chemically synthesized the 1.08 million base pair  genome of the bacterium Mycoplasma mycoides from a computer record, and transplanted the synthesized genome into the existing cell of a Mycoplasma capricolum bacterium that had had its DNA removed. The \"synthetic\" bacterium was viable, i.e. capable of replicating billions of times.\r\n\r\nMycoplasma laboratorium \r\nFirst Self-Replicating Synthetic Bacterial Cell \r\n\r\nConstruction of an edge detector from individual genetic circuits\r\n\r\n\r\nhttp://www.ncbi.nlm.nih.gov/pmc/...", question_id: 12, user_id: 2, accepted: nil, body_plain: nil, send_mail: false, user_agent: "Mozilla/5.0 (Macintosh; Intel Mac OS X 10_10_0) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/45.0.2454.101 Safari/537.36", user_ip: "197.253.32.226", referrer: "http://www.onozor.com/questions/will-people-ever-learn-to-code-dna"},
