  {body: "Have you checked out the <a href=\"http://www.appelsiini.net/projects/slim-basic-auth\">official slim based authentication middleware</a>?\r\n\r\nIt was specifically built for Slim PHP microframework. You can use this middleware to implement HTTP Basic Authentication. By default middleware authenticates against array of usernames and passwords. You can also auntenticate against database or any other datasource by providing a custom authenticator.\r\n\r\nWhen using the middleware, Configuration options are passed as an array. Only mandatory parameter is users. This is an array where you pass one or more \"username\" => \"password\" combinations. Username is the key and password is the value.\r\n\r\nAn implementation would be similar to the one below:\r\n\r\n$app = new \\Slim\\Slim();\r\n\r\n$app->add(new \\Slim\\Middleware\\HttpBasicAuthentication([\r\n    \"users\" => [\r\n        \"root\" => \"t00r\",\r\n        \"user\" => \"passw0rd\"\r\n    ]\r\n]));", question_id: 15, user_id: 61, accepted: nil, body_plain: nil, send_mail: false, user_agent: "Mozilla/5.0 (Macintosh; Intel Mac OS X 10_10_4) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/45.0.2454.101 Safari/537.36", user_ip: "197.253.32.226", referrer: "http://onozor.com/questions/adding-authentication-to-rest-api-using-slim-in-php"},
  {body: "Ofcourse we can code DNA.  We can mimic a sequence of DNA segments, print off artificial DNA segments, and splice them into genomes in vivo. \r\n \r\nThe difficult part is predictability: knowing what those genes will do.  Though a great deal of genes and the proteins they produce have been categorized, understanding the expression of these genes, and all of the other effects they have is what is so difficult.  \r\n\r\nOrganisms are incredibly complicated.  Learning how to change a protein to achieve one desired result, but avoid several undesired results is very difficult and complicated.  \r\n\r\nIn biological systems, one small change will often lead to many unforeseen results. So until we learn to make the whole process a little less unpredictable, we're definitely not going into it commercially.\r\n\r\nJurassic Park is all the warning we need. :)\r\n", question_id: 12, user_id: 61, accepted: nil, body_plain: nil, send_mail: false, user_agent: "Mozilla/5.0 (Macintosh; Intel Mac OS X 10_10_4) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/45.0.2454.101 Safari/537.36", user_ip: "197.253.32.226", referrer: "http://onozor.com/questions/will-people-ever-learn-to-code-dna"},
  {body: "People viewing answers to this question are likely more skilled developers than a friend of mine was when he made this decision about one year ago.\r\n\r\n\r\nHe ended up choosing Laravel.\r\n\r\nAccording to what he told me, It was his first time using a MVC framework. He already knew PHP, and had only written a bit of Ruby, so it was a pretty easy choice (Rails is a beast if you don't know Ruby decently well). However, the benefits of doing this were not in framework performance, or availability of resources, but rather really understanding the MVC patterns. Once it was clear how it worked in Laravel, he picked up many other frameworks in other languages very quickly. \r\n\r\nSince working with Laravel, he has quickly picked up Ruby, Node.js, \"good\" Javascript, and Objective-C, mostly based on recognizing patterns in their respective popular MVC frameworks (Rails, Express, Angular, iOS).\r\n\r\nSo I would always recommend choosing something, like a framework, based on a language you already know and are comfortable using.", question_id: 9, user_id: 61, accepted: nil, body_plain: nil, send_mail: false, user_agent: "Mozilla/5.0 (Macintosh; Intel Mac OS X 10_10_4) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/45.0.2454.101 Safari/537.36", user_ip: "197.253.32.226", referrer: "http://onozor.com/questions/ror-vs-laravel-why-should-someone-use-rails-over-laravel"},
  {body: "Because you usually want your APIs to be restful (it shouldn't store state), one of the best ways to handle authentication from users and third party apps that consume your API would be to use token based authentication.\r\n\r\nI earlier wrote <a href=\"http://blog.cent.tech/securing-a-rails-api-using-token-based-authentication/\">a very detailed post here</a> that breaks into simple steps the process of generating tokens and making them work in synchrony with established authentication systems in rails like device and bcrypt.\r\n\r\nTry following the post, then tell me if you run into any troubles.", question_id: 25, user_id: 61, accepted: nil, body_plain: nil, send_mail: false, user_agent: "Mozilla/5.0 (Macintosh; Intel Mac OS X 10_10_4) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/45.0.2454.101 Safari/537.36", user_ip: "41.75.85.2", referrer: "http://onozor.com/questions/best-way-to-authenticate-users-in-ruby-on-rails"},
  {body: "I think we Nigerians generally have a problem with giving back something (anything) that we had put effort into doing for free.\r\n\r\nIt might not necessarily mean we are not generous. I think its more associated with current poverty levels. Most of our European and American counterparts already have their basic necessities taken care of (food, shelter, clothing and internet. Yes. Internet).\r\n\r\nHowever, there's beginning to be a change in that trend. As the economy gradually improves, more Nigerian developers are embracing a change in attitude.\r\n\r\nHopefully, in no distant time, the contributions coming from not just Nigeria, but Africa as a whole would increase.", question_id: 24, user_id: 72, accepted: nil, body_plain: nil, send_mail: false, user_agent: "Mozilla/5.0 (Macintosh; Intel Mac OS X 10_10_4) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/45.0.2454.101 Safari/537.36", user_ip: "41.75.85.2", referrer: "http://www.onozor.com/questions/why-are-nigerians-not-actively-contributing-to-open-source"},
