  {body: "The health benefits of coconut oil include hair care, skin care, stress relief, cholesterol level maintenance, weight loss, boosted immune system, proper digestion and regulated metabolism. It also provides relief from kidney problems, heart diseases, high blood pressure, diabetes, HIV, and cancer, while helping to improve dental quality and bone strength. These benefits of oil can be attributed to the presence of lauric acid, capric acid and caprylic acid, and their respective properties, such as antimicrobial, antioxidant, anti-fungal, antibacterial and soothing qualities.\r\n", question_id: 29, user_id: 2, accepted: nil, body_plain: nil, send_mail: false, user_agent: "Mozilla/5.0 (Macintosh; Intel Mac OS X 10_10_0) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/46.0.2490.71 Safari/537.36", user_ip: "41.75.85.2", referrer: "http://www.onozor.com/questions/what-are-the-benefits-of-coconut-oil"},
