  {body: "Nice. @ceembalnig. But I just got one. A Clostridium Difficile (C Diff) infection. Babies don't form the toxin receptors for this gastrointestinal infection until 2 years of age, making them carriers for that deadly bacteria you keep hearing about in the news. An infection can easily kill an adult but won't cause any symptoms in babies", question_id: 26, user_id: 5, accepted: nil, body_plain: nil, send_mail: false, user_agent: "Mozilla/5.0 (Macintosh; Intel Mac OS X 10.10; rv:41.0) Gecko/20100101 Firefox/41.0", user_ip: "41.75.85.2", referrer: "http://onozor.com/questions/what-can-kill-an-adult-but-not-a-baby"},
