  {body: "Fear", question_id: 26, user_id: 76, accepted: nil, body_plain: nil, send_mail: false, user_agent: "Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_0) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/46.0.2490.71 Safari/537.36", user_ip: "41.75.85.2", referrer: "http://onozor.com/questions/what-can-kill-an-adult-but-not-a-baby"},
  {body: "One of very first criteria that pops on everyone's lips is passion. But passion itself is relative. Is the person passionate about the job, or the company goal?\r\nA team member passionate about the job would do it really well without complaints making it look effortless. A team member passionate with the company's goal will view whatever task he/she is doing as a necessary brick on the company's future wall.\r\n\r\nNeither is sufficient by themselves. \r\n\r\nA job-passionate guy who doesn't care about the company's goals will neither channel his innovations towards the Company's dream, nor stick through unpleasant times (especially when better offers roll by).\r\n\r\nA guy who loves the goals but not the job necessary for the goals to be achieved will eventually be a clog in the wheel of Company progress. He always approaches work with the right attitude, but end up getting little done.\r\n\r\nFind a merger of both, combined with character values like discipline, confidence, empathy, honesty and a willingness to learn and teach, and every other skill you seek can be quite easily added to such individual.", question_id: 31, user_id: 5, accepted: nil, body_plain: nil, send_mail: false, user_agent: "Mozilla/5.0 (Macintosh; Intel Mac OS X 10.10; rv:41.0) Gecko/20100101 Firefox/41.0", user_ip: "41.75.85.2", referrer: "http://www.onozor.com/questions/getting-the-right-team-members-onboard"},
  {body: "Adding to @innocentamadi 's response, Forbes lists important killer traits such as :\r\n\r\nIntellectual curiosity (57%) \r\nSelf-monitoring (58%) \r\nHigh-energy (78%)\r\nProfessionalism (86%)\r\nConfidence (61%)\r\n\r\nThe percentages attached gives an idea of how sorted for these traits are.", question_id: 31, user_id: 72, accepted: nil, body_plain: nil, send_mail: false, user_agent: "Mozilla/5.0 (Macintosh; Intel Mac OS X 10_10_4) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/46.0.2490.71 Safari/537.36", user_ip: "41.75.85.2", referrer: "http://www.onozor.com/questions/getting-the-right-team-members-onboard"},
  {body: "To get to the other side. ", question_id: 23, user_id: 28, accepted: nil, body_plain: nil, send_mail: false, user_agent: "Mozilla/5.0 (Macintosh; Intel Mac OS X 10_10_0) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/46.0.2490.71 Safari/537.36", user_ip: "197.253.32.226", referrer: "http://www.onozor.com/questions/question"},
  {body: "Alexithymia itself has been misinterpreted by many to imply a condition where one is not in touch with his/her emotion. This is not always the case, as Aleximythia is merely a form of Agnosia, a condition which results in the inability to interpret sensations and hence to recognize things, typically as a result of brain damage.\r\n\r\nSo the two concepts - Alexithymia and EQ - are not exactly related, making it not very correct to attempt equating them in the first place.\r\n\r\nTo answer the question, yes, a person suffering from Alexithymia does not necessarily lose touch of his/her emotional intelligence.", question_id: 32, user_id: 5, accepted: nil, body_plain: nil, send_mail: false, user_agent: "Mozilla/5.0 (Macintosh; Intel Mac OS X 10.10; rv:41.0) Gecko/20100101 Firefox/41.0", user_ip: "41.75.85.2", referrer: "http://www.onozor.com/questions/does-having-alexithymia-equate-to-low-emotional-intelligence"},
