  {body: "Dear friend. Every child is born an atheist. We teach them religion. If you are confused about god. I suggest you read scriptures related to your religion. \r\nWait a minute who created religion. Ans: Man\r\nThe  sons of gods who created religion were the ones who challenged the then prevalent beliefs and did something orignal.\r\nGodliness and the devil are both within us and it is a daily battle going on. We chose who wins.\r\nFinally i would like to quote j krishnamurty :\"religion is for people seeking rewards and spirituality is for people seeking the truth\"\r\nBest of luck on your personal quest\r\n", question_id: 36, user_id: 9, accepted: nil, body_plain: nil, send_mail: false, user_agent: "Mozilla/5.0 (Macintosh; Intel Mac OS X 10_10_0) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/46.0.2490.71 Safari/537.36", user_ip: "197.253.32.226", referrer: "http://www.onozor.com/questions/i-don-t-believe-in-god-why"},
  {body: "It's a flammable gas.", question_id: 55, user_id: 94, accepted: nil, body_plain: nil, send_mail: false, user_agent: "Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_1) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/46.0.2490.86 Safari/537.36", user_ip: "197.253.32.226", referrer: "http://www.onozor.com/questions/is-fire-a-solid-liquid-or-gas"},
  {body: "Whilst the answer to the question as stated is infinity (the same infinity, not bigger or smaller), the more important message is that some of the familiar arithmetic rules no longer apply when infinities are involved. For example, you can't cancel out infinities or take away infinity from both sides of an equation and hope for the result to still be true.\r\n\r\nFor example, this is true:   4 + infinity = 5 + infinity    (because both sides equal infinity)\r\n\r\nBut subtracting infinity from each side does not come with any guarantee that the resulting equation will be true. It is not valid to argue that subtracting infinity from both sides proves that 4 = 5. \r\n\r\nSo \"cardinal arithmetic\" (as it is called) is quite limited in what it can prove or what use it can be. \r\n\r\nYour 6 year old is showing natural imagination in generalising the use of concepts, but no realistic problem would lead to the need to frame the question \"what is infinity plus infinity\". Obversely, many apparent paradoxes (thought experiments) can be built around these constructs.", question_id: 38, user_id: 9, accepted: nil, body_plain: nil, send_mail: false, user_agent: "Mozilla/5.0 (Macintosh; Intel Mac OS X 10_10_0) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/46.0.2490.71 Safari/537.36", user_ip: "197.253.32.226", referrer: "http://www.onozor.com/questions/what-is-infinity-plus-infinity"},
