  {body: "You can use the angularjs-rails gem which integrates nicely and is easy to setup. Here is a link to the gem https://github.com/hiravgandhi/angularjs-rails \r\nFollow the setup and this is a link to a helpful tutorial on working with angular and rails https://www.youtube.com/watch?v=R96rw9vEtiQ", question_id: 62, user_id: 37, accepted: nil, body_plain: nil, send_mail: false, user_agent: "Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_1) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/46.0.2490.86 Safari/537.36", user_ip: "41.75.85.2", referrer: "http://www.onozor.com/questions/how-do-you-use-angularjs-with-ruby-on-rails"},
  {body: "My high school Integrated Science textbook defined fire/flame as a `region` where gases are burnt (i.e. react at high temperatures). It further described the various parts of a flame characterized by the ionized gases/particles present there.\r\nGoing by that definition I could say fire is actually a **PLACE**.\r\nBut then that's a high schooler's definition right? #JustSaying", question_id: 55, user_id: 44, accepted: nil, body_plain: nil, send_mail: false, user_agent: "Mozilla/5.0 (Macintosh; Intel Mac OS X 10.10; rv:38.0) Gecko/20100101 Firefox/38.0", user_ip: "41.75.85.2", referrer: "http://onozor.com/questions/is-fire-a-solid-liquid-or-gas"},
  {body: "Infinity is a range rather than a definite number. So saying (infinity + 5) is like saying:\r\n\r\nnumbers  greater than 5 plus 5 : This will definitely result to a number greater than 5, relating this to infinity, we can say conclusively that            \r\n\r\n infinity + 5 will result in infinity\r\n\r\nand if you increase from 5 to a number greater than 5, say 10, you will get \r\n\r\ninfinity +10 = infinity.\r\n\r\nSo you can conclude that infinity + infinity = infinity, since the value will  always be greater than the initial\r\n\r\n", question_id: 38, user_id: 111, accepted: nil, body_plain: nil, send_mail: false, user_agent: "Mozilla/5.0 (X11; Linux x86_64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/47.0.2526.80 Safari/537.36", user_ip: "197.253.32.226", referrer: "http://www.onozor.com/questions/what-is-infinity-plus-infinity"},
