  {body: "Thank you for the A2A\r\nThe short answer is yes.\r\nMany people believe writing a book is easy and that one day they will do it. I have to confess I was one of those people once. When I eventually got around to writing my first book, Fishing for Stones, I soon found out how much work goes into one.\r\nThese are just some of the things you must consider.\r\nIs your story interesting?\r\nDoes the plot have any 'holes' in it?\r\nIs the dialogue natural?\r\nAre your characters believable and would your reader be interested in what happens to them?\r\nIs the timeline continuous, e.g. do you have characters greeting each other like long lost friends when it's the first time they've met, or someone is in two places at the same time.\r\nIf you have real places and events in your story (I do), is your depiction of them accurate?\r\nThese are just some of the factors to consider when you make the first draft. Once you have written those final two words, THE END, then you have to go back over the entire story, looking for mistakes in grammar and spelling, and rewriting material to make it more readable.\r\nFishing for Stones took somewhere in the region of three years to write. I would say at least fifty percent of that time was doing research. I might take half a day researching something that was just one sentence long in the book. The truth has to be accurate so the lies (your story) are credible.\r\nAt the end of it I felt both physically and mentally drained, and yet I had already started the next book, Harry. Although I anticipated that to be released in the autumn 2015, I've still not finished writing. If writing was my full-time job then maybe I would, but writing part-time makes the whole process longer and you have to force yourself to write something each day.\r\nIs it worth it? Hell, yes. There is nothing to compare to seeing your book on sale either online or in a bookstore. That is your creation, no one else has made that. And when you get positive feedback from a reader and you know you have been into someone's life and given them pleasure, even if it's only for a brief period, that is a wonderful feeling.", question_id: 75, user_id: 105, accepted: nil, body_plain: nil, send_mail: false, user_agent: "Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_1) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/47.0.2526.106 Safari/537.36", user_ip: "105.112.20.21", referrer: "http://www.onozor.com/questions/is-it-hard-to-write-a-book"},
