  {body: "Instagram. Instagram is almost easier to make money on than YouTube. Here's how to make money on Instagram.\r\n\r\nAffiliate Marketing. Affiliate marketing is basically when you promote a product and get paid per sale.\r\nCreate Sponsored Posts (Find Sponsors!)\r\nSell your photos. Gallery exhibits like Gray Malin, Tyler Shields and Jayanta. Or, sell on an ecomm site. Read more: Printing money on Instagram\r\nPromote a business, products or services. Get brands to pay for things you would shoot anyway.\r\nSell your Instagram account.", question_id: 93, user_id: 153, accepted: nil, body_plain: nil, send_mail: false, user_agent: "Mozilla/5.0 (Windows NT 6.1; rv:46.0) Gecko/20100101 Firefox/46.0", user_ip: "105.112.40.179", referrer: "http://onozor.com/questions/entrepreneurship-what-s-the-best-way-for-a-teenager-to-make-money"},
  {body: "I have a saying. I'm not sure it's original with me because it is the result of simple observation.\r\n\r\nMy saying is this: \"Everybody does what they really want to do.\"\r\n\r\nYou have figured out who you want to be? Good. But it's a lie because youre not doing it. Why? Because, everyone does what they really want to do.\"\r\n\r\nWhat you really want to do is spend your time posting questions on Quora. Or hanging out with your friends. Or watching TV. Or, as you say, browsing the Internet. THAT what you really want to do if you were honest with yourself.\r\n\r\nIn the last analysis, youre a poser, not a person with dreams. You are talking the talk but not walking the walk.\r\n\r\nAm I being too harsh here? Maybe so. Sorry.\r\n\r\nBut when you say, I am tired of this life,\" I want to puke. From what you say, you apparently don't know anything about life. Youre lost in some kind a dreamworld. You are out of touch with yourself, your own expectations and the real world.\r\n\r\nFrom your question and explanation, it appears to me that what you really want to do is whine.\r\n\r\nLet me give you an action plan that will possibly change your life.\r\n\r\nFirst, find a competent counselor and tell that person how you feel. I predict that they will give you some kind of medication to alleviate your depression. You're going to be shocked when your depression lifts. You'll get a in entirely new perspective on things. No excuses, just go.\r\n\r\nSecond, stop talking about wanting to change your life, and just do it. Yes, it is that simple. Yes, there may be baby steps in the beginning but you will be moving forward. No excuses, just take action.\r\n\r\nI wish you all the best.", question_id: 94, user_id: 155, accepted: nil, body_plain: nil, send_mail: false, user_agent: "Mozilla/5.0 (Macintosh; Intel Mac OS X 10_10_3) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/51.0.2704.84 Safari/537.36", user_ip: "105.112.42.62", referrer: "http://www.onozor.com/questions/how-do-i-completely-change-my-life-the-way-i-want-it-to-be"},
  {body: "A well trained theist will define God as something along the lines of the ground of being which is a well used phrase that doesnt seem to impress people anymore.\r\n\r\nPagan and neo-pagan theistic conceptions are always very anthropocentric. They are powerful beings, even creators, but they are always beings among beings.\r\n\r\nAlso, starting in the late medieval to early modern era God started to get sort of redefined (or at least expressed differently), where his will was seen as supreme. That is why someone like Kant could believe God could have willed a different set of logical principles to rule the universe. A modern philosopher David Bently Hart calls this view Theistic Personalism and accuses the likes of William Lane Craig and Alvin Plantiga of it. Here is a youtube video about the acusation, and Craigs response.\r\n\r\nAll theists will today claim God as being something of an ultimate reality though. This is due to the tag teaming of Platonism and Christianity really pushing out paganism over the centuries. However, not all other views of God were pagan. Hinduism had a sense of God as the supreme being. Hart, who I mentioned earlier and is an Eastern Orthodox philosopher and theologian, actually used a sanscrit phrase (sat chit ananda) in the title of his book on God since he thought it captured what the divine must be like so well (being, consciousness, bliss). So there is admitted overlap.\r\n\r\nFor the Christian theologian the answer to this question goes back to the only time in the Bible God names himself when he calls himself I am I am. This syllogism is important for both a Christian and Jewish understanding of defining God becasue it is essentially God defining himself. God is (exists as) the one who exists. This isnt circular reasoning since ", question_id: 95, user_id: 156, accepted: nil, body_plain: nil, send_mail: false, user_agent: "Mozilla/5.0 (Macintosh; Intel Mac OS X 10_10_3) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/51.0.2704.84 Safari/537.36", user_ip: "105.112.42.62", referrer: "http://www.onozor.com/questions/how-would-a-theist-define-god-at-least-the-one-he-believes-in"},
  {body: "Firstly, let me say that Abraham did not sacrifice his son, so there is nothing to condemn,  Here is the text:\r\n\r\nGenesis 22.\r\n\r\n22 Some time later God tested Abraham. He said to him, Abraham!\r\n\r\nHere I am, he replied.\r\n\r\n2 Then God said, Take your son, your only son, whom you loveIsaacand go to the region of Moriah. Sacrifice him there as a burnt offering on a mountain I will show you.\r\n\r\n3 Early the next morning Abraham got up and loaded his donkey. He took with him two of his servants and his son Isaac. When he had cut enough wood for the burnt offering, he set out for the place God had told him about. 4 On the third day Abraham looked up and saw the place in the distance. 5 He said to his servants, Stay here with the donkey while I and the boy go over there. We will worship and then we will come back to you.\r\n\r\n6 Abraham took the wood for the burnt offering and placed it on his son Isaac, and he himself carried the fire and the knife. As the two of them went on together, 7 Isaac spoke up and said to his father Abraham, Father?\r\n\r\nYes, my son? Abraham replied.\r\n\r\nThe fire and wood are here, Isaac said, but where is the lamb for the burnt offering?\r\n\r\n8 Abraham answered, God himself will provide the lamb for the burnt offering, my son. And the two of them went on together.\r\n\r\n9 When they reached the place God had told him about, Abraham built an altar there and arranged the wood on it. He bound his son Isaac and laid him on the altar, on top of the wood. 10 Then he reached out his hand and took the knife to slay his son. 11 But the angel of the Lord called out to him from heaven, Abraham! Abraham!\r\n\r\nHere I am, he replied.\r\n\r\n12 Do not lay a hand on the boy, he said. Do not do anything to him. Now I know that you fear God, because you have not withheld from me your son, your only son.\r\n\r\n*********************\r\n\r\nThis genre of writing is called a text of terror.  There are many such texts in very old historical writings, and particularly in religious texts.\r\n\r\nAt the end of the story, God sends Abraham a ram to sacrifice instead, so Isaac is safe.\r\n\r\nVarious explanations are offered for the story, including:\r\n\r\n1. it was a precursor to God sacrificing his own son.\r\n\r\n2. it was a test of Abraham's faith\r\n\r\n3. it was a typical macho text of the time - proving that men will sacrifice women and children.\r\n\r\n4. it's a metaphor and didn't really happen.\r\n\r\nWe must all conclude whatever we choose, but in the story, Abraham did not sacrifice his son.\r\n\r\n", question_id: 96, user_id: 157, accepted: nil, body_plain: nil, send_mail: false, user_agent: "Mozilla/5.0 (Macintosh; Intel Mac OS X 10_10_3) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/51.0.2704.84 Safari/537.36", user_ip: "105.112.42.62", referrer: "http://www.onozor.com/questions/do-any-modern-christians-condemn-abraham-s-sacrifice-of-isaac"},
  {body: "People actually have/had books in their homes as well.   I and several of my friends had a set of encyclopedias.   There were also magazine subscriptions to mags like National Geographic in my home that brought new and current information.  Such magazines were also available at the library.  Then there was the news on TV Anything else we could easily get at the library.   \r\n\r\nI lived in a smaller town and I remember  when at school we had a reserach paper assigned many of us would congregate at the city library.  It was like a party in the reference section.  Lots of fun.   No cell phones so we talked to each other, interacted, had fun.   Good times!", question_id: 97, user_id: 158, accepted: nil, body_plain: nil, send_mail: false, user_agent: "Mozilla/5.0 (Macintosh; Intel Mac OS X 10_10_3) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/51.0.2704.84 Safari/537.36", user_ip: "105.112.42.62", referrer: "http://www.onozor.com/questions/how-did-people-in-the-past-look-up-information-if-they-used-books-does-that-mean-they-looked-for-it-whenever-they-needed"},
  {body: "It is important to know what is supervised learning and a basic supervised classification algorithm such as nearest neighbour method. You should know what an input datsaset is, what an output dataset means and in general what a loss function is used for. Linear algebra knowledge of working with matrices helps and a basic knowledge of how to differentiate a function also helps.", question_id: 101, user_id: 163, accepted: nil, body_plain: nil, send_mail: false, user_agent: "Mozilla/5.0 (Macintosh; Intel Mac OS X 10_10_3) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/51.0.2704.84 Safari/537.36", user_ip: "105.112.42.62", referrer: "http://www.onozor.com/questions/how-much-of-machine-learning-must-one-know-to-understand-and-go-through-the-new-course-of-deep-learning-offered-by-google-at-udacity"},
  {body: "Batman v Superman: Dawn of Justice was not a failure.Thats a misconception fueled by memes and internet silliness.\r\n\r\nBatman v Superman made $871 million worldwide. Domestically-speaking it is the number 12 ranked superhero movie of all time.\r\n\r\nThat puts it ahead of Iron Man, Iron Man 2, The Amazing Spider-Man, Captain America: The Winter Soldier and all of the X-Men films. All of them. Would you say that they were a failure?\r\n\r\nBatman v Superman did underperform, based on very lofty goals. What Warner Brothers wanted were those celestial box office numbers for the Marvel Studios Avengers films and they fell far short of that.\r\n\r\nIf youre talking about failure with critics and word-of-mouth, then plenty of people saw that coming. Warner Brothers was surprised though.\r\n\r\nZack Snyder was the director on Man of Steel. Many of the problems that people had with Man of Steel were magnified with Batman v Superman. Warner Brothers should have studied the reaction to Man of Steeland worked out the problems in the scripting and pre-production stage.\r\n\r\nThis 2015 article on WhatCulture mentions the darkness issue:\r\n\r\nBut it's also literally dark. Like, so dark. That's been a criticism of Man Of Steel and of all the images released from Dawn Of Justice so far, with Superman's usually bright red, yellow and blue muted to the point of monochrome, and Ben Affleck's Batman literally being unveiled in a black and white image.\r\n\r\nhttp://whatculture.com/film/10-p...\r\n\r\nThis 2015 article from Forbes mentions the casting issue with Jesse Eisenberg:\r\n\r\nPerhaps even more worrisome to me is the villain. I have a really, really hard time accepting Jesse Eisenberg as Lex Luthor. Maybe its my own fault here, but Ive seen Eisenberg in enough things and he very rarely strays from playing himself.\r\n\r\nhttp://www.forbes.com/sites/erik...\r\n\r\nHeres a 2015 interview with The Walking Dead creator Robert Kirkman about cramming half the Justice League into one movie:\r\n\r\n[The plan] just seems derivative, so it puts them in a backseat position to Marvel. Its not organic so theres going to be so much scrutiny on Batman vs. Superman when it comes out. Its got an uphill battle.If they hadnt told anybody if the Justice League were going to appearing in that, and they were forming that, it would have been surprising and exciting and weird. People are forgetting how important the surprise is.\r\n\r\nhttp://www.slashfilm.com/creator...\r\n\r\nThe problem wasnt that people didnt see the inherent issues with Batman v Superman it was how tone-deaf Warner Brothers was in addressing the problems that everyone knew was coming.", question_id: 104, user_id: 165, accepted: nil, body_plain: nil, send_mail: false, user_agent: "Mozilla/5.0 (Windows NT 6.1) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/51.0.2704.84 Safari/537.36", user_ip: "105.112.40.179", referrer: "http://www.onozor.com/questions/why-didn-t-anyone-see-batman-v-superman-s-failure-coming"},
  {body: "Summary: if you think Scrum and Agile are the same thing, you're more likely to hate Agile.\r\n\r\nWhen I teach Agile classes, it's been my experience that many in the Agile community were never taught the point of Agile, which is reducing the cost of change and uncertainty. In fact, I see from some responses here that people are conflating specific Agile techniques  such as Scrum  with Agile. Teaching Scrum as Agile is like teaching chess by explaining how the pieces move but not mentioning checkmate. Unfortunately, that's what the Agile community is doing today and it's understandable that many people are getting caught in that trap.\r\n\r\nWhen to Use Agile\r\n\r\n\r\nI think the problem started with the Agile Manifesto: many people who were very good at software development found a way of developing software which was better under the assumption of change. It's that last bit which everyone forgets: under the assumption of change. That's the key and if you don't grasp that, you'll be able to tell people the rules of chess, but look puzzled when they ask you about checkmate.\r\n\r\nAgile, in short, is nothing more than lowering the cost of change and uncertainty. If you have little change and uncertainty, Agile is a rubbish choice and you should choose a system optimized for reliability and reproducibility. These are not the same thing, no matter how much many Agile practitioners protest otherwise. For example, do you really want to \"fail fast\" when building a nuclear reactor? Not unless you're an idiot. Reliability and reproducibility are more valuable here. Optimizing for change and uncertainty is probably also bad for, say, accounting. Unless you're Enron, you probably want your accounting results to be reliable and reproducible. You want accounting to be boring, not exciting.\r\n\r\nSo how do you choose between Agility or Stability? A good rule of thumb is to know where your product is in its life cycle, along with the maturity of the market you're in, and choose Agility for newer products/markets. Products tend to go  through a series of transformations in their life-cycle (deliberately numbered in the order the transitions occur):\r\n\r\nNovelty (Cool! What can we do with this?)\r\nStability  \r\nCommodity  \r\nUtility (Boring! Let someone else do this.)\r\nNovelty: This  is for new, exciting ideas. Consider e-commerce: originally we had no idea what we could do with that. It seemed crazy to sell food or cars online, but books and electronic parts? Those seemed possible. And would people trust us with credit card numbers or their bank account numbers? People just didn't know, even though today the answers seem obvious. Everyone was rushing around trying to create these systems and no one was sure if the market was there or what it looked like. The dot-com collapse came about in part because this area grew so fast with so little understanding. A good indicator of this stage is when we're still saying \"that's really cool!\" (and frequently have detractors saying \"that's really stupid\").\r\n\r\nStability: This is when new ideas become stable products. As things settled down in e-commerce, we began to understand the market and started building our own, custom e-commerce systems (I did myself for one company) with a basic understanding of  the needed features. A good indicator of this stage is when we shift from talking about what we can build to explaining how we can build it (remember all of those \"How to build a shopping cart?\" articles and  books in the late 90s, early 00s?)\r\n\r\nCommodity: The market has matured and the products have started to become interchangeable. Now, many companies offer e-commerce software you can buy or download as open source/free software. The good has moved beyond  \"stability\" to be a bunch of interchangeable, competing goods which often are forced to compete on price instead of value (but see the note at the end of this response).\r\n\r\nUtility: Now the product has been converted into a service you can buy. Now there are plenty of online services which allow you to upload images, add descriptions of your goods, set prices, and kick back and reap the profits (good luck!). For many people this is the most boring step in the product life cycle, but it's also the most exciting because huge changes are built on top of it (think of the myriad industries build on the utilities of cloud computing, or even electricity itself!)\r\n\r\nWhen moving from Novelty to Utility, project management should move from Agile to Lean to Stable (PRINCE2, TQM, ISO9000, etc.). At this point, the reasons should be self-evident. With new markets we don't know where they're going to be in five years, and creating a five year plan (Big Design Up Front) would be about as successful as the Soviet five-year plans and fail for the same reasons: planning when we have the least information. With very mature products, optimizing for change and uncertainty which never arrives is, well, silly (this excludes the Black Swan events we can't plan for, such as owning a taxi company and Uber  showing up).\r\n\r\nSo where is Google? Google largely built many of the markets they're in and today, some of them, such as online advertising, have gone from novelties to utilities. In fact, when Google recently contacted me about being a project manager in site reliability engineering, I had to explain to the recruiter that the project management they wanted didn't fit my Agile background: site reliability is the very definition of \"reliability and reproducibility.\" Agile would be silly for many Google projects, but it's very appropriate (and used) for other projects in Google.\r\n \r\nRecap: Agile is nothing more than focusing on reducing the cost of uncertainty and change. To understand if that's a worthwhile focus, you need to know both your product and the market. Internally a company will likely have many different departments and some should definitely use Agile (R&D is a  great example) and some should definitely not (Accounting). As products/services mature, they should transition from Agile to Lean to more formal methodologies such as TQM, PRINCE2, ISO9000, and so on (interesting that there's no catch-all term for the latter).\r\n\r\nIf the whole novelty/stability/commodity/utility discussion was interesting to you, I highly recommend reading the following:\r\n\r\nAn introduction to Wardley (Value Chain) Mapping\r\n\r\nWardley uses some slightly different terminology, but his work is incredibly  valuable in helping companies form strategy (and, incidentally, to understand when to be Agile).\r\n\r\nNotes:\r\n\r\nCommodities: When I discuss commodities, this step sometimes confuses people because there's an assumption that commodities are universally interchangeable, but that's not true. A good is a substitute for another good according to the needs of the individual consumer, not just the market. Coal is coal is coal. However, people point to the differences between Apache, IIS, Nginx, etc., as perfect examples of items that are not commodities. If you can't taste the difference between Coke, Pepsi, or RC Cola, they're perfect substitutes for you and must compete on price. Likewise, if I only need a Web server for hosting my resume/CV, I really don't care which Web server it is: they're interchangeable to me and thus they're commodities to me.\r\n\r\nProduct evolution: You can apply the above to many areas. Information products evolve faster than physical ones, but many physical products undergo this process. While electricity is often cited as an example, look at the evolution of cars. Originally they came in many shapes and sizes (novelty!), but basic features stabilized into products and many cars today seem virtually indistinguishable to many consumers (commodities). Today Uber, Lyft, and Google self-driving cars are converting the commodity into a utility and people are tremendously underestimating what a seismic shift in the market this is. How much money will households save if they don't  need to buy a car or pay for its insurance? How many lives will be saved by fewer accidents?  How many lives will be lost because organ donors largely come from car accidents? How will your life be improved by turning your garage into another room? How will job markets adjust when professional drivers become an anachronism?", question_id: 107, user_id: 167, accepted: nil, body_plain: nil, send_mail: false, user_agent: "Mozilla/5.0 (Windows NT 6.1) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/51.0.2704.84 Safari/537.36", user_ip: "197.210.172.75", referrer: "http://www.onozor.com/questions/why-do-some-developers-at-strong-companies-like-google-consider-agile-development-to-be-nonsense"},
  {body: "There is only one reason: they no longer believed they could do better than $26.2 Billion, risk and time adjusted. Even though they were worth far more just a few months earlier.\r\n\r\nNo one really wants to sell. Sometimes, yes, CEOs get tired. But I didnt see that, from a distance at least, in Jeff Weiner. If you are totally burnt out, and cant recruit a replacement better than you  fair and good reason to sell.\r\n\r\nAnd sometimes, non-founder CEOs have strong economic incentives to sell (golden parachutes + large equity acceleration). That doesnt appear to be the prime motive here at all. And even if it were (which it isnt), it wouldnt be Reid Hoffmans motivation.\r\n\r\nAlso, perhaps, they were worried about shareholder activists forcing change at the company given the slowing growth. Dealing with shareholder activists these days is a huge headache, and the trade-offs they can try to force on you on maximizing for cash flow, forcing layoffs, cutting back equity compensation  can be very challenging.\r\n\r\nBut otherwise, the only reason is that you see this as Maximum Value, risk and time adjusted.\r\n\r\nOtherwise, even at 20% Year-over-Year growth, why sell? Just in 3.54 years, your revenues will double again. And again.\r\n\r\nPerhaps Jeff Weiner, coming from Yahoo!, saw an endgame of zero or tiny growth. Perhaps Reid Hoffman saw something like this as well. Either or both of them must have.\r\n\r\nBut if $26.2 Billion isnt as good as you believe you can get, as a public company already worth $19 Billion on its own the day before, and having been worth more than $32 Billion just a few months earlier  why sell?", question_id: 99, user_id: 160, accepted: nil, body_plain: nil, send_mail: false, user_agent: "Mozilla/5.0 (Macintosh; Intel Mac OS X 10_10_3) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/51.0.2704.84 Safari/537.36", user_ip: "105.112.42.62", referrer: "http://www.onozor.com/questions/why-did-linkedin-sell-to-microsoft"},
  {body: "Duh.\r\n\r\nBecause in the search for profit, a privately owned media organisation will do anything to sell its publication. It has to so so, to maximise profit.\r\n\r\nIt's even got a name - it's called  \"Capitalism\" a method of organising society which is overtly enthusiastically supported by privately owned  proprietors  and organisations like\r\n\r\nBertelsmann\r\nGannett Co.\r\nThe Hearst Corporation\r\nNews Corp\r\nTribune Company\r\nWashington Post Co.\r\nIn the UK we have an alternative - it's a called the BBC and thoughtful questions like yours realting to the \"broadcast\" media are actually discussed in the open, in programmes like the Media Show  and Woman's Hour .  We don't have a publicly owned newspaper outlet in the UK.\r\n\r\nThis is only possible because the BBC is publicly owned with a mission statement which requires .  There are still problems with alleged Right wing and  Left-wing bias, but being publicly owned with certain protocols to follow, we, the public can at a least go into the question of how things are done.  Here are the links to the first four of protocols:", question_id: 98, user_id: 160, accepted: nil, body_plain: nil, send_mail: false, user_agent: "Mozilla/5.0 (Macintosh; Intel Mac OS X 10_10_3) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/51.0.2704.84 Safari/537.36", user_ip: "105.112.42.62", referrer: "http://www.onozor.com/questions/why-does-the-press-insist-on-using-the-names-of-people-committing-multiple-murders-in-headlines"},
  {body: "I have been in exactly the same place. Psychologically you have to come to terms with something. NOBODY LEARNS TO DO IT RIGHT THE FIRST TIME. Just let yourself get a result of anykind. That means being DRY and writing at the proper level of abstraction comes later. Resign yourself to throwing away your first baby after several rounds of refactoring. And most answers are kinda half-assed on the coding forums. \r\n\r\nAlso, ALL LANGUAGES ARE FLAWED. If you look for the perfect OOP or FUNCTIONAL approach in a given situation, chances are you'll realize it's not there!!! Just learn the way that you can best remember and move on.\r\n\r\nA Practical Path\r\n\r\nI wouldn't recommend this path to someone without your background. It risks too many pigeonholes for the neophyte. \r\n\r\nWhat you need is a stack that gives instant gratification. You need minimal configuration so you don't get bogged down in editing she'll scripts. And you need aspects of that chain to become intelligible to you as your knowledge expands. \r\n\r\nIf your environment is a *nix and hasn't taken too much of a beating from various installs from failed development attempts, install on it. Ifnot, stand up a fresh virtual machine with Ubuntu or something.\r\n\r\nInstall git, node.js and then harp.js. Don't bother with databases, connectors to your favorite api or any of that shit yet.\r\n\r\nLesson 1 - follow the harp.js directions till you're looking at your first page. Play around till you're familiar with jade and markdown. Pay special attention to adding tags and scripts to the page. Use HTMLTidy, JSBeautify, or whatever to look at the out put and compare it to the input. Congratulations you're using a rendering engine and you're learning 3 markup languages and a bit of CSS and LESS at the same time.\r\n\r\nLesson 2 - Learn how to change CSS attributes for standard tags, classes and ids. The learn to use variables, loops and conditionals in LESS. Learn how to include another LESS file. Harp.js will do the rendering work for you. Congratulations, you now know how to apply the three core grammars of a programming language to do something cool in a language that is EVERYWHERE.\r\n\r\nLesson 3 - Get the source code package for BOOTSTRAP. Copy the LESS files into the right spot and include bootstrap.less in your less file.\r\n\r\nGo through the CSS section on the bootstrap site and play with tags and content. Congratulations, you're using a library to speed the process of doing something you already have the skills to do yourself. Go look at some of those LESS files and CAREFULLY READ THEM. Enjoy understanding someone else's code.\r\n\r\nLesson 4 - Use JAVASCRIPT to replace the content of a div or other DOM tag. Replace everything with a p tag with the word, \"Suweet!\" Now learn how to make an array and access an element of that array. Make \"suweet\" the 3rd element in the array and replace all the p tags with it. Now learn how to iterate through the array and display a list.\r\n\r\nLesson 5 - Spend a few days learning simple Javascript stuff from Thau's book or W3Schools. Have some fun with it. Learn how to make objects and acess their properties and methods. Then learn to use a callback function. Notice I said, \"Learn to use....\"  Understanding the callback function might be SUPER irritating at this point. \r\n\r\nCongratulations you've had some fun with a language and finished up by learning the feature that will betray you constantly until you master it - then, if you're really as versed in theory as you say, it will make you feel dirty. Javascript without mastering the callback is a toy. With it, it's a slowly collapsing black hole that will eat the lives of a generation of developers.\r\n\r\nDEAL WITH IT. Magic always betrays you. Complexity management is a boring drag like buying insurance. That's why nobody does it. Worry about it when you're further along the learning curve.\r\n\r\nYou can hardly get anything done on the Web without Javascript. JQUERY, NODE.JS and the rest of the pony show use callbacks and nested callbacks for EVERYTHING. Don't fear using deep nests of callbacks, you'll be in good company and have some ugly war stories to share.\r\n\r\nLesson 6 - Learn basic JQUERY. Do the same things from lesson 5 but do them the JQUERY way. \r\n\r\nLesson 7 - Get bootstrap fully folded into your harp.js playground. Make version 0 of your personal website with it using LESS and the rest of what you've learned.\r\n\r\nLesson 8 - build a reply form that uses node.js to send you an alert.\r\n\r\nLesson 9 - use what you've learned so far to make a publish-to-site.js file that automates harp.js publishing your site as static html via SFTP or some other secure protocol.\r\n\r\nAt this point you've created a really sophisticated toolchain for building and managing your web site. It should be easy to operate and maintain and should also stay FAR out of the way of any cool web app stuff you might want to try. You have many of the benefits of Wordpress without being stuck in the Wordpress world running off of mySQL.\r\n\r\nIf you get this far and nothing has grabbed you.... Try Python again but this time focus entirely on text processing until RegEx is a second language. Then learn everything you can about Bayes - start with the Statistics class at Udacity.  ;)", question_id: 100, user_id: 160, accepted: nil, body_plain: nil, send_mail: false, user_agent: "Mozilla/5.0 (Macintosh; Intel Mac OS X 10_10_3) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/51.0.2704.84 Safari/537.36", user_ip: "105.112.42.62", referrer: "http://www.onozor.com/questions/how-can-i-learn-coding-at-home-without-losing-motivation"},
  {body: "I think its football. More than 175 countries play football. A good fraction of these have leagues that go on for most part of the year.\r\n\r\nFor example, in England there is the Premier League, which is watch by fans across the globe. Same goes for Sire A (Italy), La Liga (Spain), Ligue 1 (France) and Bundesliga (Germany). And not to mention the leagues in Russia, Netherlands, and other countries, the Champions league, the Europa League, lower leagues, knockout cups like the FA cup, etc.\r\n\r\nThere are relatively fewer international matches, but a huge audience, including those who dot normally watch football watch events like Copa America, the Asia Cup, the European cup, etc., not to mention the huge viewership during the World Cup. Yes, these are once-in-four-years events, but they get a huge amount of viewership.\r\n\r\nI think its unlikely that any other sport has so much viewership.", question_id: 102, user_id: 164, accepted: nil, body_plain: nil, send_mail: false, user_agent: "Mozilla/5.0 (Windows NT 6.1) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/51.0.2704.84 Safari/537.36", user_ip: "105.112.40.179", referrer: "http://www.onozor.com/questions/what-is-the-number-one-watched-sport"},
  {body: "The USSR. Russia today is absent its satellite nations of the Baltics, eastern Europe, Balkans and the Ukraine, but in 1984 those territories were also a part of the Soviet Union. Even today, but more so then, the land mass and the resources available within its territory were, and are enormous, with: abundant energy, mineral, agricultural and fishery resources spanning 9 time zones, with access on its west to the North Sea and Atlantic Ocean, and to its east, the Black Sea and Pacific Ocean. It also has the largest freshwater body in the world within its borders, and its entire north is in the Arctic, which has both abundant fisheries and is rich in hydrocarbon resources. With the combined populations within all its union of states, it was within the top third of the worlds largest populations, more than India and just slightly less than China.", question_id: 103, user_id: 166, accepted: nil, body_plain: nil, send_mail: false, user_agent: "Mozilla/5.0 (Macintosh; Intel Mac OS X 10_10_3) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/51.0.2704.84 Safari/537.36", user_ip: "105.112.42.62", referrer: "http://www.onozor.com/questions/if-you-could-choose-one-nation-in-1984-to-rule-which-one-would-you-choose"},
  {body: "1. Ned Stark - Never underestimate your enemies, and never let them know what you're up to.\r\n\r\n2. Joffery Baratheon- Be nice to people, its not that difficult; especially to those with the capability to murder you.\r\n\r\n3. Lyanna Stark- Be careful when you fool around with married folks, or just don't do it at all.\r\n\r\n4. Tyrion Lannister - Embrace what makes you different.\r\n\r\n5. Cersei Lannister - Loving your children, doesn't mean hating everyone else.\r\n\r\n6. Varys & Littlefinger - Knowledge is power.\r\n\r\n7. Robert Baratheon - Not everyone was meant to rule a nation\r\n\r\n8. Arthur Dayne - No matter how good you are, you are still human.\r\n\r\n9. Stannis Baratheon - Not everything will go the way you want it to.\r\n\r\n10. Robb Stark - Always keep your word and sometimes duty comes before honor.\r\n\r\n11. Arya Stark - With enough determination, you can do amazing things\r\n\r\n12. Hot Pie - Sometimes being a \"scaredy-cat\" can save your life.\r\n\r\n13. Melissandre - Having faith in a higher power is good, but never become blinded by it.\r\n\r\n14. Tywin Lannister - Never judge a book by its cover, it could be your demise.\r\n\r\n15. Oberyn & Doran Martell - Patience is key, all things in time.\r\n\r\n16. Sandor \"The Hound\" Clegane - Know what is worth fighting for, and what isn't.\r\n\r\n17. Jon Snow - Stay strong and follow your heart.\r\n\r\n18. Daenarys Targaryen - There is a difference between Conquering and Ruling; Ruling and Leading.\r\n\r\n19. Bronn - Know when to have your own best interest at heart.\r\n\r\n20. Samwell Tarly - Follow your dreams with all your heart and you'll get what you desire.\r\n\r\n21. Olenna Tyrell - Intimidation can be a powerful weapon, but act when the situation demands it.\r\n\r\n22. Lysa Arryn - Know the difference between those who love you, and those who want to use you.\r\n\r\n23. Sansa Stark - See the world as it is, not as you want it to be.\r\n\r\n24. Davos Seaworth - Always remain loyal, even when it hurts.\r\n\r\n25. Grenn - Everyone is capable of achieving great things.\r\n\r\n26. Robin Arryn - Be wary of those that wish to use and manipulate you.\r\n\r\n27. Khal Drogo - Sometimes changing your tradition is a bad thing. Stick to what you know.\r\n\r\n28. Pyat Pree - Never piss off dangerous people.\r\n\r\nThere's more but I think that should do it.", question_id: 105, user_id: 165, accepted: nil, body_plain: nil, send_mail: false, user_agent: "Mozilla/5.0 (Windows NT 6.1) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/51.0.2704.84 Safari/537.36", user_ip: "105.112.40.179", referrer: "http://www.onozor.com/questions/what-lesson-can-we-learn-from-each-character-of-game-of-thrones"},
  {body: "Fukuzawa Yukichi graces the 10,000 yen note in Japan even today. He and other great minds like him translated Western classics of politics and economics, analyzed their meaning critically, and proposed making a deal with the West that would allow Japan to maintain its independence. He was critical of the West but he saw the need to compete at their level to avoid being victims of their less noble instincts. As he wrote:\r\n\r\nRobbery and murder are the worst of human crimes; but in the West there are robbers and murderers. There are those who form cliques to vie for the reins of power and who, when deprived of that power, decry the injustice of it all. Even worse, international diplomacy is really based on the art of deception. Surveying the situation as a whole, all we can say is that there is a general prevalence of good over bad, but we can hardly call the situation perfect. When, several thousand years hence, the levels of knowledge and virtue of the peoples of the world will have made great progress (to the point of becoming utopian), the present condition of the nations of the West will surely seem a pitifully primitive stage. Seen in this light, civilization is an open-ended process. We cannot be satisfied with the present level of attainment of the West.\r\n\r\nBunmeiron no Gairyaku [An Outline of a Theory of Civilization] (1875).\r\n\r\nFukuzawa was able to convince many Japanese to commit themselves to rule of law and industry, so that the entire world might one day benefit. He brought the West to the East in a surprisingly fast way.", question_id: 108, user_id: 168, accepted: nil, body_plain: nil, send_mail: false, user_agent: "Mozilla/5.0 (Windows NT 6.1) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/51.0.2704.84 Safari/537.36", user_ip: "197.210.172.75", referrer: "http://www.onozor.com/questions/how-did-japan-become-wealthy"},
  {body: "Adobe Photoshop", question_id: 14, user_id: 170, accepted: nil, body_plain: nil, send_mail: false, user_agent: "Mozilla/5.0 (Windows NT 6.1; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/49.0.2623.87 Safari/537.36", user_ip: "105.112.40.100", referrer: "http://www.onozor.com/questions/design-software"},
  {body: "Nice one", question_id: 108, user_id: 2, accepted: nil, body_plain: nil, send_mail: false, user_agent: "Mozilla/5.0 (Macintosh; Intel Mac OS X 10_10_3) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/51.0.2704.103 Safari/537.36", user_ip: "41.219.180.155", referrer: "http://www.onozor.com/questions/how-did-japan-become-wealthy"}
