Question.create!([
  {name: "CPanel email will send but not receive. How can I fix this?", body: "I've recently set up a new website. We're currently setting up email accounts but unfortunately they're not able to receive incoming mail. I'm guessing it's something to do with the DNS settings but I don't have a clue how to rectify this.\r\n\r\nThe Delivery Status Notification that one gets when emailing it is:\r\n\r\nThe error that the other server returned was:\r\n550 5.1.1 <MYEMAILADDRESS> recipient rejected\r\n\r\nI'm not entirely sure what's wrong. If you need any more information, I'll be happy to provide.\r\n\r\n", user_id: 104, views: 4, answers_count: 0, permalink: "cpanel-email-will-send-but-not-receive-how-can-i-fix-this", answer_id: nil, send_mail: true, slug: "cpanel-email-will-send-but-not-receive-how-can-i-fix-this", category_id: 1, ancestry: nil, comments_count: 0, favourites_count: 0, picture: nil, page_id: nil, questionable_type: nil},
  {name: "How does Warren Buffett keep healthy despite the trash food that he eats?", body: "I admire Mr. Buffetts energy for holding a shareholder meeting for several hours at the age of 85. It is no secret to his followers that he loves to eat and drink trash food. He has not only lived beyond 80 but remains energetic and surely smarter than me at 85. How the hell does he do it?\r\n\r\n", user_id: 104, views: 0, answers_count: 0, permalink: "how-does-warren-buffett-keep-healthy-despite-the-trash-food-that-he-eats", answer_id: nil, send_mail: true, slug: "how-does-warren-buffett-keep-healthy-despite-the-trash-food-that-he-eats", category_id: 10, ancestry: nil, comments_count: 0, favourites_count: 0, picture: nil, page_id: nil, questionable_type: nil},
  {name: "Who is the best?", body: "Who is the best Aka or Cassper nyovest", user_id: 170, views: 1, answers_count: 0, permalink: "who-is-the-best", answer_id: nil, send_mail: true, slug: "who-is-the-richest-male-artistes", category_id: 8, ancestry: nil, comments_count: 0, favourites_count: 2, picture: nil, page_id: nil, questionable_type: nil},
  {name: "You are vs. you're  what is the difference between them?", body: "I get confused between the two a lot. I want to understand how to use them appropriately because I hate making mistakes.", user_id: 105, views: 0, answers_count: 0, permalink: "you-are-vs-you-re-what-is-the-difference-between-them", answer_id: nil, send_mail: true, slug: "you-are-vs-you-re-what-is-the-difference-between-them", category_id: 9, ancestry: nil, comments_count: 0, favourites_count: 0, picture: nil, page_id: nil, questionable_type: nil},
  {name: "What is the logic behind sending emails on Rails API?", body: "I have been wondering since the rails API have no view and the template middleware has been removed from the stack. it seems almost impossible to send mail because sending a mail in rails either needs an 'ERB' template  or a text template. please if you have a workaround on how to fix this let me know.", user_id: 155, views: 1, answers_count: 0, permalink: "what-is-the-logic-behind-sending-emails-on-rails-api", answer_id: nil, send_mail: true, slug: "what-is-the-login-behind-sending-emails-on-rails-api", category_id: 1, ancestry: nil, comments_count: 0, favourites_count: 2, picture: nil, page_id: nil, questionable_type: nil},
  {name: "How did Japan become wealthy?", body: "How did Japan become wealthy?", user_id: 168, views: 6, answers_count: 2, permalink: "how-did-japan-become-wealthy", answer_id: nil, send_mail: true, slug: "how-did-japan-become-wealthy", category_id: 14, ancestry: nil, comments_count: 0, favourites_count: 1, picture: nil, page_id: nil, questionable_type: nil},
  {name: "Why do some developers at strong companies like Google consider Agile development to be nonsense?", body: "Why do some developers at strong companies like Google consider Agile development to be nonsense?", user_id: 167, views: 7, answers_count: 1, permalink: "why-do-some-developers-at-strong-companies-like-google-consider-agile-development-to-be-nonsense", answer_id: nil, send_mail: true, slug: "why-do-some-developers-at-strong-companies-like-google-consider-agile-development-to-be-nonsense", category_id: 1, ancestry: nil, comments_count: 0, favourites_count: 1, picture: nil, page_id: nil, questionable_type: nil},
