  {name: "Why does the press insist on using the names of people committing multiple murders in headlines?", body: "It seems that non-stop blaring of the names of perpetrators of incidents at Santa Barbara, Wilton CT, Columbine, etc. does much to cement their notoriety, and may offer at least some encouragement to psychopaths contemplating such crimes.  By making their identities instantly recognizable, it also creates an unimaginable burden on their families in dealing with the massive reaction to these incidents.\r\n\r\nI understand that the press must cover these incidents, and probably needs to provide their names somewhere in the coverage, but it doesn't seem that it would hamper their coverage or ability to compete for readers/listeners if they refrain from naming the perpetrators in a headline, sub-head, or lead, or placing their picture above the fold (so to speak).", user_id: 158, views: 2, answers_count: 1, permalink: "why-does-the-press-insist-on-using-the-names-of-people-committing-multiple-murders-in-headlines", answer_id: nil, send_mail: true, slug: "why-does-the-press-insist-on-using-the-names-of-people-committing-multiple-murders-in-headlines", category_id: 11, ancestry: nil, comments_count: 0, favourites_count: 0, picture: nil, page_id: nil, questionable_type: nil},
