  {name: "Why does Mark Zuckerberg have a 99% approval rating from his employees?", body: "I recently read an article stating that Mark Zuckerberg had a 99% employee approval rating. Other CEOs with high employee approval ratings included Larry Page, Tim Cook, Marc Benioff, etc. \r\n\r\nWouldn't having a lower approval rating, to some degree, be a good thing? If all of your employees agree with you and with the direction you're taking the company, wouldn't that mean that you team isn't diversified enough? Doesn't some disagreement/confrontation, in the proper environment, help companies create truly remarkable products?\r\n\r\nI read that when Steve Jobs first joined Pixar, he asked who the most \"difficult\" employee to work with was, and that's who he wanted to collaborate with...and look at the success of Pixar.\r\nAnswer\r\nRequest\r\n", user_id: 2, views: 5, answers_count: 1, permalink: "why-does-mark-zuckerberg-have-a-99-approval-rating-from-his-employees", answer_id: nil, send_mail: true, slug: "why-does-mark-zuckerberg-have-a-99-approval-rating-from-his-employees", category_id: 1, ancestry: nil, comments_count: 0, favourites_count: 1, picture: nil, page_id: nil, questionable_type: nil},
