  {name: "how can i used Ionic with rails?", body: "Ionic framework is the youngest in our top 5 stack, as the alpha was released in late November 2013. Built on top of the popular AngularJS framework from Google, Ionic utilizes AngularJS to provide the application structure, while Ionic itself focuses on the user interface. In other words, we see a match between the power of Angular and the beauty of Ionic .\r\n\r\nIonic provides a set of Angular directives (custom HTML elements) for its own components, making it as easy to use the widgets as writing a line of HTML code. In addition to directives, Ionic uses Angulars touch re, view animation logic, HTML sanitation, and asynchronous communication.", user_id: 115, views: 1, answers_count: 0, permalink: "how-can-i-used-ionic-with-rails", answer_id: nil, send_mail: true, slug: "how-can-i-used-ionic-with-rails-a86c7821-7a83-4140-acdc-6454a223ce50", category_id: nil, ancestry: nil, comments_count: 0, favourites_count: 1, picture: nil, page_id: nil, questionable_type: nil},
  {name: "how can i used Ionic with rails", body: "Ionic framework is the youngest in our top 5 stack, as the alpha was released in late November 2013. Built on top of the popular AngularJS framework from Google, Ionic utilizes AngularJS to provide the application structure, while Ionic itself focuses on the user interface. In other words, we see a match between the power of Angular and the beauty of Ionic UI.\r\n\r\nIonic provides a set of Angular directives (custom HTML elements) for its own components, making it as easy to use the widgets as writing a line of HTML code. In addition to directives, Ionic uses Angulars touch recognizers, view animation logic, HTML sanitation, and asynchronous communication.", user_id: 115, views: 3, answers_count: 4, permalink: "how-can-i-used-ionic-with-rails", answer_id: nil, send_mail: true, slug: "how-can-i-used-ionic-with-rails", category_id: nil, ancestry: nil, comments_count: 0, favourites_count: 1, picture: "v1458389053/ysmtsstp9owv5foxmgjz.png", page_id: nil, questionable_type: nil},
