  {name: "Is family really all that important?", body: "I can't wait for the day I turn 18 because I will finally be free from home, and from all the stupid rules my parents make. I know some of the rules are important, like curfew, but I mean like when my step mom says I can't have the water running. Or I can't put the cups on the top shelf, because she can't reach them (we have a step-stool), so I have to cram cups and it looks super tacky.\r\n \r\nI feel like I could find really cool people somewhere out beyond my door, but everyone says that \"family is the most important\", or \"your brother is your best friend\". I don't really believe that, because me and him bicker and say the most hateful stuff to each other that we can think of (especially him to me).\r\n \r\nSo, is family really that important? Should I really want to put up with my semi-crazy step mom, or my inconsiderate brother. What about my dad, who although is a smart man, does not spend a lot of time with me because he is sooo busy providing?", user_id: 98, views: 7, answers_count: 0, permalink: "is-family-really-all-that-important", answer_id: nil, send_mail: true, slug: "is-family-really-all-that-important", category_id: 15, ancestry: nil, comments_count: 0, favourites_count: 1, picture: nil, page_id: nil, questionable_type: nil},
