  {name: "GUYS, CAN YOU DO THIS ON YOUR WEDDING DAY?", body: "Nigerians are quickly tapping into a lot of the western worlds cultures and practices, like celebrating Halloween, Thanksgiving, painting easter eggs, baby shower, and bridal showers.\r\n\r\nNow I have heard that removing the garter is now part of the wedding rituals we are borrowing from the western world.\r\n\r\nRemoving the garter involves the groom using his teeth to remove the garter (fasteners for stockings) from the brides thighs and throwing it to the grooms men.\r\n\r\nNow guys, to my question: Can you do the removing the garter ritual on your wedding day?", user_id: 2, views: 51, answers_count: 3, permalink: "guys-can-you-do-this-on-your-wedding-day", answer_id: nil, send_mail: true, slug: "guys-can-you-do-this-on-your-wedding-day", category_id: 7, ancestry: nil, comments_count: 0, favourites_count: 3, picture: "v1453196613/ztyyyiaytqjk3rgtd0wz.jpg", page_id: nil, questionable_type: nil},
