  {name: "Whats new in Rails 5?", body: "Rails 5 is right around the corner (currently targeting Fall 2015) and there are some exciting features coming up. If you are running a Rails shop, you need to prepare your apps for this major release.\r\n\r\nDont worry. As always, we at Sitepoint will guide you throughout the migration process when the release date approaches. For now, lets catch you up on whats coming and how it will improve your development process.\r\n\r\nMajor Improvements\r\nThere are some amazing announcements that will fundamentally shift how we work with Rails. New features like Action Cable and improved Turbolinks that can instantly improve our web development workflow. Lets look at each of them in detail.\r\n\r\nMerging Rails API\r\nOver the last few years, many thanks to Backbone.js and Angular.JS, the number of Single Page Applications (SPAs) are on the rise. The last few projects that I have built have been purely SPA and using Rails for these cases was an overkill. I tried dabbling with Sinatra and even pure Rack applications, but ended up writing too much boilerplatee. The routing was lacking compared to Rails and there were too many security vulnerabilities that I had to handle. I had to either write it on top of the community driven rails-api gems or live with traditional Rails.\r\n\r\nIn Rails 5, the rails-api gem will be merged into core allowing the use of Rails as a simple JSON API. Personally, I find this a great addition. I wont have to look further while building an API for my javascript (and other) appliciation clients.\r\n\r\nRuby 2.2.1\r\nRuby 2.2 was a great addition to the Ruby community. Not only did it bring a huge performance boost to Ruby, but it also introduced a slew of new functions. In addition, garbage collection of symbols was widely celebrated. Legend has it that Dragons of Valeria rained down rose petals on the Seventh Kingdom when this announcement was made. OK! Maybe I took that too far, but you get the general picture.\r\n\r\nNOTE: Before migrating to Rails 5 you need to make sure that your app works on Ruby 2.2.1.\r\nDue to these enhancements, Ruby 2.2+ was a ripe candidate for Rails 5. Rails 5 will only work on Ruby 2.2.1 and above.\r\n\r\nTurbolinks 3\r\nTraditional web apps tend to be slow due to full page reloads. One way to solve this is just reloading the bare minimum content area. Turbolinks solve this by just reloading the contents of the body from the server, instead of refreshing the entire page. While this improves the performance to a certain extent, this is also relatively slow. Turbolinks 3 aims to solve this.\r\n\r\nTubolinks 3 allows you to retain most of your page and selectively update certain regions through partials. This is very similar to how SPAs work, and you can choose to do all this from the server. Sounds great, right?\r\n\r\nThis is a great feature as the flock moves towards single page apps. However, at first glance, it looks like youll have to manage the partials manually. This means that youll have to remember which part of the app to reload at a specific point. To me, it adds a lot of clutter to my code and makes it easy to screw up. Personally, I prefer using something like React, which handles this very well with the Virtual DOM.\r\n\r\nNote: The way React works is, it maintains a Virtual DOM where all the manipulations happen. It then diffs the Virtual DOM and the actual DOM and makes only the required changes. It ensures that DOM is hit only when absolutely required and the changes are bare minimum.\r\nHaving said that, for the folks who dont like to meddle around with JS, this offers an instantaneous performance boost.\r\n\r\nAction Cable\r\nMany projects these days use WebSockets to push live updates to the client. While most client browsers have started to support this, we still need a robust client on the server to manage the subscribers and send an update signal appropriately. This feature is available out of the box in some of the newer frameworks, like Phoenix for Erlang. However, the Rails community had to resort to third party implementations, like Pushr, to get this working.\r\n\r\nNote: For the uninitiated, WebSockets is a W3C standard that opens up a duplex connection from your browser. Servers can talk (i.e., push updates) to clients as needed, and asynchronously update the clients state without a full page reload. For instance, this is how Gmail loads new emails without reloading the entire page.\r\nRails traditionally offers all the tools that one needs to build a great app out of the box. Thats one reason why it is so popular, especially among the startup community. The lack of WebSocket support was a reason for major discontent among the community. It looks like the Rails core team took note of this and came up with Action Cable. Well have to wait for some time to see how this is going to work in real life, but its exciting nevertheless.\r\n\r\nSome Niceties\r\nRake Inside Rails\r\nFor many a Rails noob, having to figure out when to use rake and when to use rails is a source of confusion. Now you dont need to switch context between the rake and rails commands. You can run all Rake tasks with the rails keyword. For instance,\r\n\r\nrake db:migrate\r\nwill now become:\r\n\r\nrails db:migrate\r\nThis may not look like much on the surface, but this will make the lives of beginners much simpler. Rails 5 will also add a restart command that quickly restarts the application.\r\n\r\nActive Record Changes\r\nOne change that almost went unnoticed was the update to belongs_to. When you create a Student belongs_to Class relation, it was possible to create a student without an associated Class relation. This lead to a lot of data inconsistencies. With Rails 5, he parent has become mandatory. If you try to insert an empty record here, Active Record will throw up.\r\n\r\nChanges to Controller Tests\r\nIf youre testing what your template renders in your controller, you are doing it wrong. A simple change to your template will leave you with sleepless nights, hunting down the culprit. Thats why, in Rails 5, assert_template is deprecated. However, you can continue using assert_select to check if a specific DOM element is present.\r\n\r\nIf youve been testing the instance variables inside a controller method, you should note that assigns is also going away.\r\n\r\nIf youre writing controller tests, the new decree is that you should be concerned with cookies, HTTP return code, and DB calls, if any. Wait, that sounds just like an integration test. Well, you got me therecontroller tests will likely be dropped in favor of integration tests in the future.\r\n\r\nNote:* Checkout Rails Dom testing for more details and best practices.\r\nWrapping Up\r\nWith javascript playing a dominant role in web development today, web frameworks are getting reduced to mere API services. The Rails core team realizes this and is moving in the right direction. Feel free to join us in the comments section for a discussion.\r\n", user_id: 2, views: 11, answers_count: 0, permalink: "whats-new-in-rails-5", answer_id: nil, send_mail: false, slug: "whats-new-in-rails-5", category_id: 1, ancestry: nil, comments_count: 0, favourites_count: 3, picture: nil, page_id: nil, questionable_type: nil},
  {name: "How do I use cloudinary with reactjs?", body: "I've been trying to implement cloudinary on a reactjs app I'm building. I'm using cloudinary for load and the documentation states that I should be able to upload an image by specifying the file name or the image url.\r\n\r\nFor some reason, this seems not to be the case as I keep having a 'post_request.setTimeout is not a function' error whenever I call cloudinary.uploader.upload.\r\n\r\nI'd appreciate any pointers. Thanks.", user_id: 61, views: 7, answers_count: 0, permalink: "how-do-i-use-cloudinary-with-reactjs", answer_id: nil, send_mail: false, slug: "how-do-i-use-cloudinary-with-reactjs", category_id: nil, ancestry: nil, comments_count: 0, favourites_count: 0, picture: nil, page_id: nil, questionable_type: nil},
