  {name: "How can I build wealth from modest beginnings without falling prey to bogus \"get rich\"  schemes and fads?", body: "There are a lot of resources out there that offer solid advice for accumulating assets and building wealth, but it is rare to find a straightforward answer to \"where should I start\" if one currently has a modest level of savings and income.", user_id: 82, views: 57, answers_count: 3, permalink: "how-can-i-build-wealth-from-modest-beginnings-without-falling-prey-to-bogus-get-rich-schemes-and-fads", answer_id: nil, send_mail: true, slug: "how-can-i-build-wealth-from-modest-beginnings-without-falling-prey-to-bogus-get-rich-schemes-and-fads", category_id: 14, ancestry: nil, comments_count: 0, favourites_count: 3, picture: nil, page_id: nil, questionable_type: nil},
  {name: "Is this Application Build by a developer at Andela?", body: "I have heard a lot about Andela but not too sure how technical they are, I have been going through their website and they are promising they will training 10,00000 developers in 10 years and recently I saw a retweet about this app.\r\n\r\n```\r\n[TWEET Oct 7]\r\n\"pretty nifty Q&A platform built by an @Andela developer in training  http://www.onozor.com/  send constructive feedback to @onozor :)\"  \r\n```\r\n\r\nI will like to confirm that this app was thoroughly built by one of their trainees. ", user_id: 79, views: 70, answers_count: 4, permalink: "is-this-application-build-by-a-developer-at-andela", answer_id: nil, send_mail: true, slug: "is-this-application-build-by-a-developer-at-andela", category_id: 1, ancestry: nil, comments_count: 0, favourites_count: 4, picture: nil, page_id: nil, questionable_type: nil},
  {name: "How many times, on average, do software engineers fail their technical interviews before landing an offer?", body: "I'm new to the technical interview world. \r\n\r\nA bit of background on me: \r\n\r\nI just graduated college in June 2014 and was fortunate enough to have a job lined up after graduation. I actually worked as a software engineer there for my entire last year of school (~30 hours/week), so I got some great experience under my belt. Unfortunately, that company didn't survive and I was forced to look for a new position.\r\n\r\nI was approached by a friend of mine who was starting a new company and was offered the lead position as co-founder of the company immediately after leaving my old job. Of course I said yes because we had all sorts of partnerships already lined up and who doesn't want to take on the challenge of leading a project?\r\n\r\nAnyways, as it currently stands we're in a bit of a stale-mate with the funding rounds so I'm forced to look for new positions elsewhere until the company proves to have at least a good enough runway to leave (this will most likely be a long time from now).\r\n\r\nAs of today, I've had quite a few interviews with companies like Google, Facebook, etc...but I've been failing all of them or at least getting the \"we've decided to pursue other candidates\" replies.\r\n\r\nObviously, this constant rejection is demoralizing and a real slap in the face of motivation and confidence.\r\n\r\nSo, my question is, how often do software engineers fail these interviews / how many interviews does it take to nail the process? My main problem is I don't even know what I'm doing wrong. I'll answer the questions, the solutions will be correct (albeit not ALWAYS the most efficient but I usually only have 45mins to come up with an algorithm), and then I'll get an email saying I didn't pass. What am I missing?", user_id: 13, views: 6, answers_count: 0, permalink: "how-many-times-on-average-do-software-engineers-fail-their-technical-interviews-before-landing-an-offer", answer_id: nil, send_mail: false, slug: "how-many-times-on-average-do-software-engineers-fail-their-technical-interviews-before-landing-an-offer", category_id: 1, ancestry: nil, comments_count: 0, favourites_count: 2, picture: nil, page_id: nil, questionable_type: nil},
