  {name: "How does Facebook News feed collects its data?", body: "f a Facebook user wall has some sort of technical problem and because of it, a wall post send by his/her friend doesn't appear, is it possible that the attempted post would show in News feed only?\r\n\r\nAny pointers on how FaceBook news feed is designed to prevent situations like described above?", user_id: 2, views: 4, answers_count: 0, permalink: "how-does-facebook-news-feed-collects-its-data", answer_id: nil, send_mail: true, slug: "how-does-facebook-news-feed-collects-its-data", category_id: 13, ancestry: nil, comments_count: 0, favourites_count: 1, picture: nil, page_id: nil, questionable_type: nil},
  {name: "She is nice and pretty but not very smart. How can I tell her without hurting her?", body: "For a few months I have been dating a woman. She is very pretty and I had a good feeling about her, I liked her way of behaving, of dressing, etc. She's a \"no bullshi*t\" woman if you know what I mean, easy going, seemingly very sincere. We really match in quite some things. I'm 49 and she is 55 if that helps in any way.\r\n\r\nBut with time I have learnt that she is not very intelligent or smart. Not lacking education or culture, just not very clever intellectually. Without wanting to sound arrogant I consider myself quite an intelligent man, and it's frustrating that I can not hold some intelligent conversations with her because she has a lot of trouble getting what I'm talking about or understanding things properly.\r\n\r\nAs much as I like her I do not love her enough as to feel that my love for her is over that weakness. I need my partner to be intelligent enough so that I do not feel frustrated every time we talk about anything more serious than small talk.\r\n\r\nI'm afraid that because of this reason she is not the right one for me, but how can I handle the situation? I like her otherwise and I don't want to hurt her, it's not her fault if she is not very intelligent. I can not just tell her: \"look you are a very nice woman but you are too dumb for me so it will not work\". I really don't want having to say that, but I don't like lying either.\r\n\r\nOne last thing, she is crazy in love with me, she sees me as a \"gift from heaven\" in her own words, what she had been waiting for all of her life etc. So stopping the relationship is not going to be an easy thing at all, she's going to try to hold on to it by any means...\r\n\r\nWhat could I do?\r\n\r\nTX", user_id: 79, views: 10, answers_count: 1, permalink: "she-is-nice-and-pretty-but-not-very-smart-how-can-i-tell-her-without-hurting-her", answer_id: nil, send_mail: false, slug: "she-is-nice-and-pretty-but-not-very-smart-how-can-i-tell-her-without-hurting-her", category_id: 11, ancestry: nil, comments_count: 0, favourites_count: 0, picture: nil, page_id: nil, questionable_type: nil},
