  {name: "What is Facebook's architecture?", body: "From various readings and conversations I had, my understanding of Facebook's current architecture is:\r\nWeb front-end written in PHP. Facebook's HipHop Compiler [1] then converts it to C++ and compiles it using g++, thus providing a high performance templating and Web logic execution layer.\r\nBecause of the limitations of relying entirely on static compilation, Facebook's started to work on a HipHop Interpreter [2] as well as a HipHop Virtual Machine which translate PHP code to HipHop ByteCode [3].\r\nBusiness logic is exposed as services using Thrift [4]. Some of these services are implemented in PHP, C++ or Java depending on service requirements (some other languages are probably used...)\r\nServices implemented in Java don't use any usual enterprise application server but rather use Facebook's custom application server. At first this can look as wheel reinvented but as these services are exposed and consumed only (or mostly) using Thrift, the overhead of Tomcat, or even Jetty, was probably too high with no significant added value for their need.\r\nPersistence is done using MySQL, Memcached [5], Hadoop's HBase [6]. Memcached is used as a cache for MySQL as well as a general purpose cache.\r\nOffline processing is done using Hadoop and Hive.\r\nData such as logging, clicks and feeds transit using Scribe [7] and are aggregating and stored in HDFS using Scribe-HDFS [8], thus allowing extended analysis using MapReduce\r\nBigPipe [9] is their custom technology to accelerate page rendering using a pipelining logic\r\nVarnish Cache [10] is used for HTTP proxying. They've prefered it for its high performance and efficiency [11].\r\nThe storage of the billions of photos posted by the users is handled by Haystack, an ad-hoc storage solution developed by Facebook which brings low level optimizations and append-only writes [12].\r\nFacebook Messages is using its own architecture which is notably based on infrastructure sharding and dynamic cluster management. Business logic and persistence is encapsulated in so-called 'Cell'. Each Cell handles a part of users ; new Cells can be added as popularity grows [13]. Persistence is achieved using HBase [14].\r\nFacebook Messages' search engine is built with an inverted index stored in HBase [15]\r\nFacebook Search Engine's implementation details are unknown as far as I know\r\nThe typeahead search uses a custom storage and retrieval logic [16]\r\nChat is based on an Epoll server developed in Erlang and accessed using Thrift [17]\r\nThey've built an automated system that responds to monitoring alerts by launching the appropriated repairing workflow, or escalating to humans if the outage couldn't be overcome [18]. \r\nAbout the resources provisioned for each of these components, some information and numbers are known:\r\nFacebook is estimated to own more than 60,000 servers [18]. Their recent datacenter in Prineville, Oregon is based on entirely self-designed hardware [19] that was recently unveiled as Open Compute Project [20].\r\n300 TB of data is stored in Memcached processes [21]\r\nTheir Hadoop and Hive cluster is made of 3000 servers with 8 cores, 32 GB RAM, 12 TB disks that is a total of 24k cores, 96 TB RAM and 36 PB disks [22]\r\n100 billion hits per day, 50 billion photos, 3 trillion objects cached, 130 TB of logs per day as of july 2010 [22]\r\n\r\n[1] HipHop for PHP: http://developers.facebook.com/b...\r\n[2] Making HPHPi Faster: http://www.facebook.com/note.php...\r\n[3] The HipHop Virtual Machine: http://www.facebook.com/note.php...\r\n[4] Thrift: http://thrift.apache.org/\r\n[5] Memcached: http://memcached.org/\r\n[6] HBase: http://hbase.apache.org/\r\n[7] Scribe: https://github.com/facebook/scribe\r\n[8] Scribe-HDFS: http://hadoopblog.blogspot.com/2...\r\n[9] BigPipe: http://www.facebook.com/notes/fa...\r\n[10] Varnish Cache: http://www.varnish-cache.org/\r\n[11] Facebook goes for Varnish: http://www.varnish-software.com/...\r\n[12] Needle in a haystack: efficient storage of billions of photos: http://www.facebook.com/note.php...\r\n[13] Scaling the Messages Application Back End: http://www.facebook.com/note.php...\r\n[14] The Underlying Technology of Messages: https://www.facebook.com/note.ph...\r\n[15] The Underlying Technology of Messages Tech Talk: http://www.facebook.com/video/vi...\r\n[16] Facebook's typeahead search architecture: http://www.facebook.com/video/vi...\r\n[17] Facebook Chat: http://www.facebook.com/note.php...\r\n[18] Who has the most Web Servers?: http://www.datacenterknowledge.c...\r\n[19] Building Efficient Data Centers with the Open Compute Project: http://www.facebook.com/note.php...\r\n[20] Open Compute Project: http://opencompute.org/\r\n[21] Facebook's architecture presentation at Devoxx 2010: http://www.devoxx.com\r\n[22] Scaling Facebook to 500 millions users and beyond: http://www.facebook.com/note.php...", user_id: 9, views: 31, answers_count: 2, permalink: "what-is-facebook-s-architecture", answer_id: nil, send_mail: true, slug: "what-is-facebook-s-architecture", category_id: 0, ancestry: nil, comments_count: 0, favourites_count: 0, picture: nil, page_id: nil, questionable_type: nil},
  {name: "Why didn't Mark Zuckerberg give all users of Facebook some of his stock?", body: "I'll pretend this isn't a joke (I really hope it is). \r\n\r\n1. Giving almost 1 billion people a share of your company is a logistical nightmare; most of your users are outside of the US for starters. Would you, say, force every UK user to open an international trading account, and pay for that? \r\n\r\n2. Assuming FB is worth $100bn, and you gave away half, each user would receive about $50. Not exactly a princely sum, and it would probably cost >$1-2 just to give away each share anyway. \r\n\r\n3. Facebook built the company. They spend billions annually just on hosting and infrastructure. They took on the risk - and it remains a risk today - of creating and supporting all of this, operating on the *belief* that it will eventually turn a profit, one day. That's business, and frankly - they deserve to hold onto their own value. \r\n\r\nYou know what you DO get from Facebook? An amazing tool that costs billions to develop, available everywhere, for free. If you seriously want them to pay you for it too, you need an emergency course in Economics for Dummies.", user_id: 1, views: 30, answers_count: 1, permalink: "why-didn-t-mark-zuckerberg-give-all-users-of-facebook-some-of-his-stock", answer_id: nil, send_mail: true, slug: "why-didn-t-mark-zuckerberg-give-all-users-of-facebook-some-of-his-stock", category_id: 1, ancestry: nil, comments_count: 0, favourites_count: 0, picture: nil, page_id: nil, questionable_type: nil},
  {name: "How are strings terminated in C#?", body: "\r\nLorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry's standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.\r\n\r\nIt is a long established fact that a reader will be distracted by the readable content of a page when looking at its layout. The point of using Lorem Ipsum is that it has a more-or-less normal distribution of letters, as opposed to using 'Content here, content here', making it look like readable English. Many desktop publishing packages and web page editors now use Lorem Ipsum as their default model text, and a search for 'lorem ipsum' will uncover many web sites still in their infancy. Various versions have evolved over the years, sometimes by accident, sometimes on purpose (injected humour and the like).\r\n\r\n \r\nContrary to popular belief, Lorem Ipsum is not simply random text. It has roots in a piece of classical Latin literature from 45 BC, making it over 2000 years old. Richard McClintock, a Latin professor at Hampden-Sydney College in Virginia, looked up one of the more obscure Latin words, consectetur, from a Lorem Ipsum passage, and going through the cites of the word in classical literature, discovered the undoubtable source. Lorem Ipsum comes from sections 1.10.32 and 1.10.33 of \"de Finibus Bonorum et Malorum\" (The Extremes of Good and Evil) by Cicero, written in 45 BC. This book is a treatise on the theory of ethics, very popular during the Renaissance. The first line of Lorem Ipsum, \"Lorem ipsum dolor sit amet..\", comes fro", user_id: 8, views: 23, answers_count: 1, permalink: "how-are-strings-terminated-in-c", answer_id: nil, send_mail: false, slug: "how-are-strings-terminated-in-c", category_id: 1, ancestry: nil, comments_count: 0, favourites_count: 1, picture: nil, page_id: nil, questionable_type: nil},
  {name: "Nigerian Army 72 Regular Recruit Intake For 2015/2016 Out.", body: "Nigerian Army - This is to inform the general public and all interested qualified candidates that the online registration for the 72 Regular Recruits Intake for both Trades/Non Tradesmen and women will commence on 8 September 2014 and end on 18 October, 2014. \r\n\r\nNigerian Army Recruitment 72 Regular Recruits Intake 2014 for Trades/Non Tradesmen and\r\nWomen Basic Qualification Applicants must: Possess a minimum of 4 credits in not more than 2\r\nsittings in WASSCE/GCE/NECO/NABTEB. \r\n\r\nOne of the Credits must be in English Language. In addition to above qualification, those applying as tradesmen/women must also posses OND/Trade Test/City and Guild Certificate. Details are available on the website. \r\n\r\nBe between the ages of 18 - 22 years for non tradesmen/women while tradesmen/women must\r\nbe between the ages of 18-26 years by 01 November 2014. Not be less than 1.65 metres and 1.56 metres tall for male and female respectively.\r\n\r\nMethod of Application Interested candidates are to Apply online at the recruitment portal www.narecruitment.org using a Recruitment c- voucher purchased with a bank card issued by any Nigerian bank or voucher purchased from any branch of Union Bank or Unity Bank Nationwide, at the sum of One Thousand Naira (N1,000.00) only. \r\n\r\nLog on to the above mentioned link using the username and password. Complete the application form, submit online and print a copy. Then, print and complete the Guarantor Form as appropriate. \r\n\r\nCome along to the designated examination and recruitment centers with copies of their application and Guarantor Forms. \r\n\r\nPlease Note Items to note are as follows: The recruitment exercise would commence with Pre-\r\nScreening Examination to be followed later by screening of shortlisted candidates at designated\r\nZonal Centres nationwide. \r\n\r\nYou are advised to carefully read the instruction page on the website or call the following support lines if in doubt: 08098079416, 08098079026, 08098079174, 08098035427. \r\n\r\nAll shortlisted applicants are to attend the Pre-Selection Examination at the centre of their choices as indicated in the website (www.narecruitment.org ) on 1 November 2014. Candidates that sat for the Pre-Screening Examination are to check the website (www.narecuitment.org ) on 13 November, 2014 for the list of candidates shortlisted to attend the Zonal Screening Exercise. \r\n\r\nSuccessful candidates from the Pre-Selection Examination are to attend the Zonal Screening\r\nExercise at the designated Zonal Centres for their respective states from 16 November 2014.\r\n\r\nCandidates selected after the Zonal Screening Exercise will commence training immediately at Depot Nigerian Army, Zaria. Candidates are advised in their own interest, not to give any form of gratification or inducement to any person or group of persons to assist them on the recruitment exercise.\r\n\r\nRegister at:\r\nwww.narecruitment.org\r\n", user_id: 7, views: 16, answers_count: 1, permalink: "nigerian-army-72-regular-recruit-intake-for-2015-2016-out", answer_id: nil, send_mail: true, slug: "nigerian-army-72-regular-recruit-intake-for-2015-2016-out", category_id: 14, ancestry: nil, comments_count: 0, favourites_count: 0, picture: nil, page_id: nil, questionable_type: nil},
  {name: "removing field name from validation error message [duplicate]", body: "in rails 3 i don't want to show field names in error messages. Anyone know how to do that ?\r\n\r\n```validates_presence_of :title, :message => \"no title\"```\r\nit shows\r\n\r\n```Title no title ```\r\ni want\r\n\r\n```no title```", user_id: 2, views: 5, answers_count: 2, permalink: "removing-field-name-from-validation-error-message-duplicate", answer_id: nil, send_mail: true, slug: "removing-field-name-from-validation-error-message-duplicate", category_id: nil, ancestry: nil, comments_count: 0, favourites_count: 0, picture: nil, page_id: nil, questionable_type: nil},
  {name: "How does a random number generator work in programming languages? Is there any pattern?", body: "Facebook wants to unify the low level implementations and maybe talk directly to the GPU. We can have React that outputs to the virtual DOM and talks directly to the GPU and bypass all of this stack that is preparatory and build a new stack that is designed for React, said Christopher Chedeau.\r\n\r\nDevelopment of native apps is currently bottlenecked by the Play Store and the iOS App Store review processes, which require hours, days, or months of turnaround time from pushing an update to making it available to users.\r\n\r\nFacebook wants mobile developers to be able to ship their native apps continuously, just like web developers can.\r\n\r\nWe know that the [React] project right now is good, but this is not where we want to go. We are in for the long run. We are deeply committed to it.\r\n\r\nSebastian Markbage: Were trying to see more and more of these output modes. We can talk about web, Android, canvas drawing, iOS. But a lot of companies are doing [other] things. Netflix is targeting TVs using React and they have another view layer. we want to make it easier to get React on other platforms that we are not specifically focusing on. Other companies are using React for games, so running React on gaming consoles is a priority for them. Were trying to make it more decoupled from the DOM and keep going with this idea of React as a programming model.\r\n\r\nAndroid devices use Linux with the Java virtual machine. Java provides the thin runtime for communicating with Googles heavy cloud infrastructure. This is not the only model for dumb phone and smart cloud.\r\n\r\nThe JVM could be replaced with Node.js for an all-JavaScript runtime model.\r\n\r\nAtwoods Law is ever-present. JavaScript is getting fast with WebAssembly. Developers are converging on JavaScript because it is more fun and quicker to learn than mobile.\r\n\r\nWe need to break the mobile duopoly:\r\n\r\nWe already know that there are two dominant mobile operating systems out there. But the current situation doesnt really allow anyone to experiment, not without going through the interests and lenses of the two dominant players  Apple and Google.\r\n\r\nThats why we need a third mobile OS to break this duopoly and move us towards a more open environment for anyone to innovate, without permission. Especially as mobile phones have begun to democratize and broaden the reach of technology around the world why shouldnt we then also democratize the mobile operating system?\r\n\r\nBesides resulting in improved discoverability, greater ability to connect with users, and more geographic reach, a more open environment for mobile innovation gives users around the world choice.\r\n\r\nSounds like a great opportunity for Facebook", user_id: 1, views: 38, answers_count: 1, permalink: "how-does-a-random-number-generator-work-in-programming-languages-is-there-any-pattern", answer_id: nil, send_mail: true, slug: "how-does-a-random-number-generator-work-in-programming-languages-is-there-any-pattern", category_id: 1, ancestry: nil, comments_count: 0, favourites_count: 1, picture: nil, page_id: nil, questionable_type: nil}
])
