  {email: "lesmatheson@gmail.com", encrypted_password: "$2a$10$GEihk3SsEFtycwfZ0U49x.fibtorrlGMhEi.9wo.0tiZTJug7RPku", reset_password_token: nil, reset_password_sent_at: nil, remember_created_at: nil, sign_in_count: 1, current_sign_in_at: "2016-01-04 06:54:38", last_sign_in_at: "2016-01-04 06:54:38", current_sign_in_ip: "105.112.20.21", last_sign_in_ip: "105.112.20.21", username: "lesmatheson", avatar: "v1451890638/dr8u1gw7d7aam4mir8c2.jpg", views: 209, last_requested_at: "2016-01-04 07:02:53",   admin: nil,  slug: "lesmatheson", banned_at: nil, first_name: "les", last_name: "matheson", gender: "Female", bio: "For me, Quora provides an opportunity to engage with people on my favorite topic:  the nature of true self.\r\n\r\nI'm writing a book called \"The One-Piece Puzzle: true self and the fragmented world\".   It offers a distinctive view of a very well-worn subject: the relationship between identity, values, and meaning.\r\n\r\nThe essential message is that there's an evolution which takes place regarding an individual's relationship to the truth; the stages of that evolution govern ones' understanding of self and world at the same time.\r\n\r\nAn essay covering the basic theory in the book can be found here:  Levels of authenticity\r\n\r\nIf that seems a bit daunting to read, this much-shorter summary about Pseudo-objective self might be a better introduction to the perspective.\r\n\r\nMost of the answers I post are related to this topic in some way, usually they're just attempts to start a conversation, so feel free to chime in!", occupation: "", title: nil, intrest: "Writing \"The one-piece puzzle: true self and the fragmented world\"", moderator: false, only_follower_feed: false, provider: nil, uid: nil, category_id: nil, city: nil, country: nil, twitter_url: nil, facebook_url: nil, personal_website: nil, cover_photo: nil, location: nil},
